@commands.command(name="setbotav", aliases=["setbotpfp"], description="Change the bot's avatar", usage="<image>", brief="developer only")
    @commands.is_owner()
    async def setbotav(self, ctx):
        if len(ctx.message.attachments) == 0:
            return await ctx.send("upload an image")

        attatchment = ctx.message.attachments[0]

        if not attatchment.filename.lower().endswith((".png", ".jpg", ".jpeg")):
            return await ctx.send("upload a valid img file (png, jpg, jpeg)")

        try:
            attatchment_filename = attatchment.filename
            await attatchment.save(attatchment_filename)

            with open(attatchment_filename, "rb") as file:
                av_byes = file.read()

            await self.bot.user.edit(avatar=av_byes)
            os.remove(attatchment_filename)
            await ctx.send(":thumbsup:")

        except Exception as e:
            await ctx.send(f"oopsie detected: {e}")```

